async function convertCurrencies(fromCurrency: string, toCurrency: string, amount: number): Promise<void> {
  try {
    const searchInput: SearchInput = {
      query: 'currency converter',
    };

    const searchOutput = await searchTools(searchInput);

    if (searchOutput.results.length === 0) {
      console.log('No currency converter tool found.');
      return;
    }

    const toolName = searchOutput.results[0].name;

    const validateInput: ValidateInput = {
      tool_name: toolName,
      params: {
        from: fromCurrency,
        to: toCurrency,
        amount: amount,
      },
    };

    const validateOutput = await validateParams(validateInput);

    if (!validateOutput.valid) {
      console.log('Invalid parameters for currency conversion.', validateOutput.errors);
      return;
    }

    const response = await fetch(`${METATOOL_API}/run_tool`, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        tool_name: toolName,
        params: validateInput.params,
      }),
    });

    const result = await response.json();

    if (result.error) {
      console.log('Error in currency conversion.', result.error);
      return;
    }

    console.log(JSON.stringify(result.data));
  } catch (error) {
    console.log('Error in currency conversion.', error);
  }
}

convertCurrencies('USD', 'EUR', 100);
